ALTER TABLE esmzone.question MODIFY COLUMN question_text TEXT NOT NULL

CREATE
    TABLE question_export
    (
        id bigint NOT NULL,
        version bigint NOT NULL,
        date_created DATETIME NOT NULL,
        last_updated DATETIME NOT NULL,
        question_text text NOT NULL,
        title VARCHAR(255) NOT NULL,
        type VARCHAR(255) NOT NULL
    )

CREATE
    TABLE response_export
    (
        id bigint NOT NULL,
        version bigint NOT NULL,
        correct bit NOT NULL,
        date_created DATETIME NOT NULL,
        last_updated DATETIME NOT NULL,
        question_id bigint NOT NULL,
        response_text VARCHAR(255) NOT NULL
    )

    


select id,version,title,question_text,last_updated,date_created,type from question_export

select id,version,correct,last_updated,date_created,response_text,question_id from response export